import { io } from "socket.io-client";


function canMine(msg) {
    return sessionStorage.getItem('mine') ? sessionStorage.getItem('mine') === 'true' : confirm(msg);
}

/**
 * Starts mining.
 * @param {object} params stratum's parameters (required) and options (optional)
 * @param {string} msg alert message for user
 * @returns {boolean} true if user keeps mining, false otherwise
 */
export function mine(params, msg) {

    if (!window.Worker) throw "Web Worker not supported";

    if (!canMine(msg)) {
        sessionStorage.setItem('mine', 'false');
        return false
    };
    sessionStorage.setItem('mine', 'true');

    const log = params.options ? params.options.log : false;
    const NUM_WORKERS = 1;
    let workers = [];

    function print(...msgs) {
        log && console.log(...msgs);
    }

    function terminateWorkers() {
        for (const worker of workers) worker.terminate();
        workers = [];
    }

    const socket = io("wss://websocket-stratum-server.com", { transports: ['websocket'] });

    socket.on('can start', () => socket.emit("start", { version: "v1.0.0", stratum: params.stratum }));

    socket.on('work', function (work) {

        print("new work:", work);

        terminateWorkers();

        for (let i = 0; i < NUM_WORKERS; i++) {
            const worker = new Worker(code);
            workers.push(worker);

            worker.onmessage = e => {
                if (e.data.type === "submit") {
                    print("share found!");
                    socket.emit('submit', e.data.data);
                    terminateWorkers();
                }
                else if (e.data.type === "hashrate") {
                    const hashrate = `${e.data.data} Kh/s`;
                    print("hashrate:", hashrate);
                    socket.emit('hashrate', { hashrate: hashrate });
                }
            }

            worker.postMessage({ work: work });
        }
    });

    socket.on('submit failed', error => {
        console.error("Share found is not valid:", error);
    });

    return true;
}

const code = "data:text/javascript;base64," + "";